import {Validator} from 'vee-validate';
import vueHljs from 'vue-hljs';
import VueResource from 'vue-resource';
import {AdminApplicationPlugin} from '../index';
import VeeValidate from 'vee-validate';
import jsonValidator from './../components/veeValidate/json';

import vueCustomElement from 'vue-custom-element';
import Vue from './init.js';

Vue.use(vueCustomElement);

Vue.use(VeeValidate, {
    inject           : true,
    enableAutoClasses: true,
    events           : 'input|blur'
});

import appManager from './manager';

Validator.extend('isJson', jsonValidator);

const SettingsResource = {
    get() {
        return Promise.resolve({
            data: {
                baseUrl           : 'localhost:8080',
                basePath          : '',
                adminPanelImageUrl: require('./panelImage.jpg'),
                imageBasePath     : '/files'
            }
        });
    }
};

const UserResource = {
    get() {
        return Promise.resolve({
            data: {
                id         : 123,
                username   : 'aaa@bbb.ccc',
                UserPermissions: [
                    {
                        permission: 'aaa.bbb',
                        value: null
                    }
                ]
            }
        });
    }
};

const AuthResource = {
    login() {
        return Promise.resolve();
    },
    logout() {
        return Promise.resolve();
    }
};

Vue.use(vueHljs);
Vue.use(VueResource);
Vue.use(AdminApplicationPlugin, {
    appManager        : appManager,
    userResource      : UserResource,
    settingsResource  : SettingsResource,
    authResource      : AuthResource,
    adminPanelImageUrl: require('./panelImage.jpg')
});

/* eslint-disable no-new */
new Vue({
    el      : '#app',
    store   : Vue.getAppStore(),
    router  : Vue.getAppRouter(),
    i18n    : Vue.getI18n(),
    template: '<AdminApplication/>',
});
